import React from "react";
import Footer from "./footer";
import Header from "./header";
import StudyCardList from "./studyCardList";

const Main = () => {
  return (
    <>
      <Header />
      <h3>오프라인</h3>
      <small>전체보기</small>
      <StudyCardList />
      <h3>온라인</h3>
      <small>전체보기</small>
      <StudyCardList />
      <Footer />
    </>
  );
};

export default Main;
